  <script>
    const slider = document.getElementById('product-feedbacks_slider');
    const buttons = document.getElementsByClassName('product-feedbacks_button');
    const cards = document.getElementsByClassName('product-feedbacks_card');
    function setActiveButton() {
      const slideRange = slider.scrollWidth - slider.offsetWidth;
      const slidePart = slideRange / cards.length;
      let cardIndex = Math.floor((slider.scrollLeft / slideRange) * cards.length);
      if (cardIndex > cards.length - 1) {
        cardIndex = cards.length - 1;
      }

      Array.from(buttons).forEach(function (button, index) {
        if (index === cardIndex) {
          button.classList.add('selected');
        } else {
          button.classList.remove('selected');
        }
      });
    }
    function productFeedbacksScrollTo(index) {
      const slideRange = slider.scrollWidth - slider.offsetWidth;
      const slidePart = slideRange / cards.length;
      slider.scrollTo({ left: index * slidePart, top: 0, behavior: 'smooth' });
    }
    slider.addEventListener('scroll', setActiveButton);
  </script>

