  var lastTouchY = 0;

  function touchstart(event) {
    var touch = event.touches[0] || event.changedTouches[0];
    lastTouchY = touch.pageY;
  }

  function touchmove(event) {
    var touch = event.touches[0] || event.changedTouches[0];
    var delta = lastTouchY - touch.pageY;
    event.currentTarget.scrollTop += delta;
    lastTouchY = touch.pageY;
  }

  function slidableMenuNavigate(target, from, to) {
    if (from < to) {
      var menuToDisplay = target.nextElementSibling;
      menuToDisplay.classList.add('active');
      menuToDisplay.addEventListener('touchstart', touchstart);
      menuToDisplay.addEventListener('touchmove', touchmove);
    } else {
      var menuToHide = target.parentNode;
      menuToHide.classList.remove('active');
      menuToHide.removeEventListener('touchstart', touchstart);
      menuToHide.removeEventListener('touchmove', touchmove);
    }
  }
</script>


