      #section-announcement {
        background: #58b35d;
        color: #ffffff;
      }

      .annoucement-content {
        position: relative;
        height: 30px;
        overflow: hidden;
      }

      .annoucement-inner-content {
        margin-bottom: 10px;
        position: absolute;
        top: 50%;
        transform: translate(-50%, -50%);
        font-size: 20px;
        transition-property: left, opacity;
        transition-duration: 0.5s;
        transition-timing-function: ease;
        width: 100%;
        margin: 0;
      }

      .annoucement-inner-content.current {
        left: 50%;
        opacity: 1;
      }

      .annoucement-inner-content.prev {
        left: 0%;
        opacity: 0;
      }

      .annoucement-inner-content.next {
        left: 100%;
        opacity: 0;
      }

      @media (max-width: 768px) {
        .annoucement-content {
          height: 20px;
        }
        .annoucement-inner-content {
          font-size: 16px;
        }
      }
    </style>

    <script>
      document.documentElement.style.setProperty('--announcement-bar-height', document.getElementById('shopify-section-announcement').offsetHeight + 'px');

      let currentItem = 1;
      window.addEventListener('load', function() {
        const annoucementContent = document.querySelector('.annoucement-content');
        const splittedContent = ["📍 Fabrication artisanale française "," 🚚 Chez vous en 4 à 6 jours ouvrés "," 🙌 Testez nos produits pendant 15 jours"];
        for (let i = 0; i < splittedContent.length; i++) {
          const annoucementInnerContent = document.createElement('span');
          annoucementInnerContent.classList.add('annoucement-inner-content');
          if (i === currentItem) {
            annoucementInnerContent.classList.add('current');
          } else if (i === currentItem + 1) {
            annoucementInnerContent.classList.add('next');
          } else if (i === currentItem - 1) {
            annoucementInnerContent.classList.add('prev');
          }
          annoucementInnerContent.textContent = splittedContent[i];
          annoucementContent.appendChild(annoucementInnerContent);
        }

        const annoucementInnerContent = document.querySelectorAll('.annoucement-inner-content');

        function getPrev(current) {
          return (current - 1 + annoucementInnerContent.length) % annoucementInnerContent.length;
        }

        function getNext(current) {
          return (current + 1) % annoucementInnerContent.length;
        }

        setInterval(function() {
          annoucementInnerContent[currentItem].classList.remove('current');
          annoucementInnerContent[getPrev(currentItem)].classList.remove('prev');
          annoucementInnerContent[getNext(currentItem)].classList.remove('next');
          currentItem = (currentItem + 1) % annoucementInnerContent.length;
          annoucementInnerContent[currentItem].classList.add('current');
          annoucementInnerContent[getPrev(currentItem)].classList.add('prev');
          annoucementInnerContent[getNext(currentItem)].classList.add('next');
        }, 3000)
      });
    </script>
