<script>
  const scrollableWrapper = document.querySelector('.PhoneList__Wrapper');

  function showScrollableButtons() {
    if (!scrollableWrapper) {
      return;
    }
    const hasScroll = scrollableWrapper.scrollWidth > scrollableWrapper.offsetWidth;
    const scrollButtons = document.getElementsByClassName('ScrollButton');
    for (const button of scrollButtons) {
      button.style.display = hasScroll ? 'flex' : 'none';
    }
  }

  window.addEventListener('resize', showScrollableButtons);

  function scrollToRight() {
    if (!scrollableWrapper) {
      return;
    }

    scrollableWrapper.scrollLeft += 150;
  }

  function scrollToLeft() {
    if (!scrollableWrapper) {
      return;
    }

    scrollableWrapper.scrollLeft -= 150;
  }

  showScrollableButtons();
</script>







</div><div id="shopify-section-design-spotlight" class="shopify-section"><script>
    let active = 1;

    function loadSpotlight(items) {
        let stt = 0;
        let translatePx = window.innerWidth > 768 ? 120 : 20;
        items[active].style.transform = `none`;
        items[active].style.zIndex = 1;


        items[active].querySelector('a').style.display = 'block';
        for(var i = active + 1; i < items.length; i++){
            stt++;
            items[i].style.transform = `translateX(${translatePx*stt}px) scale(${1 - 0.2*stt}) perspective(16px) rotateY(-1deg)`;


            items[i].querySelector('a').style.display = 'none';
        }
        stt = 0;
        for(var i = active - 1; i >= 0; i--){
            stt++;
            items[i].style.transform = `translateX(${-translatePx*stt}px) scale(${1 - 0.2*stt}) perspective(16px) rotateY(1deg)`;


            items[i].querySelector('a').style.display = 'none';
        }
    }

    function selectItem(index) {
        active = index;
        const items = document.querySelectorAll('.spotlight-slider__item');
        loadSpotlight(items);
    }

    window.addEventListener('load', function() {
        const items = document.querySelectorAll('.spotlight-slider__item');
        loadSpotlight(items);
    });
</script>

